import actionTypes from './actionTypes';

function reducer(state = [],action) {
    if (action.type === actionTypes.USERNAME_ADDED) {
        return [
            ...state,
            {
              username: action.payload.username
            }
        ];
    }

    return state;
}

export default reducer;
